// App.js
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './Home';

const App = () => {
  return (
    <>App
    <Router>
      <Route>
        <Route exact path="/" component={Home} />
        {/* Add routes for other pages if needed */}
      </Route>
    </Router>
    </>
  );
};

export default App;
